import React from "react";
import { Messages } from "./Messages";
import { InputMessages } from "./InputMessages";

export function PrivateChat(props){

    return(
        <div id="GlobalChatContainer">
            <Messages name={props.name} receiver={props.receiver} privateMessages={props.privateMessages} currentPage={props.currentPage} myId={props.myId} id={props.id}/>
            <InputMessages name={props.name} receiver={props.receiver} currentPage={props.currentPage} id={props.id} myId={props.myId}/>
        </div>
    )
}
